class ProjectListWorkRequestModel {  int? manageProjectId;  int? phaseId;  String? phaseStatus;  String? dateStart;  String? dateEnd;  ProjectListWorkRequestModel({this.manageProjectId, this.phaseId, this.phaseStatus, this.dateStart, this.dateEnd});  ProjectListWorkRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    phaseId = json['phase_id'];    phaseStatus = json['phase_status'];    dateStart = json['date_start'];    dateEnd = json['date_end'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['phase_id'] = this.phaseId;    data['phase_status'] = this.phaseStatus;    data['date_start'] = this.dateStart;    data['date_end'] = this.dateEnd;    return data;  }}